                "last_modified": "11/30/2018 15:35",
                "description": "<h2><span style=\"text-decoration: underline;\"><strong>&ldquo;Conquer The Canyon&quot; Pa Grand Canyon 1/2, Full &amp; 5k</strong></span></h2>\r\n<h3>Saturday &amp; Sunday July 27th &amp; 28th 2019</h3>\r\n<h4>Sat- 5k and 1Mile Run/Walk 8:00AM @ Wellsboro High School 225 Nichols St. Wellsboro Pa</h4>\r\n<h4>Sun-Half Marathon &amp; Full Marathon on the Rail Trail Flat Fast &amp; entirely in the Canyon</h4>\r\n<p><strong><span style=\"text-decoration: underline;\"></span><span style=\"text-decoration: underline;\">Course</span></strong>: 5k &amp; 1Mile will start @the High School and will traverse the streets through Wellsboro finishing on the HS track!! Both the Half and Full Marathons will take place on the Pine Creek Rail Trail Starting and finishing @The Darling Run Parking area Note: ALL Participants will be shuttled over from the High School on Sunday Morning Starting @5:30AM. The courses will be predominately flat and should run FAST!! The half will go 6.55 out and back, the full will do the half and then another 6.55 in the opposite direction. The marathon will be a BOSTON Qualifier!! Both the &frac12; &amp; Full will be run entirely in the Canyon!! (Flat, Fast and Extremely Scenic) Course Maps and additional Photos can be found here: <strong>https://schuylkillriverrunners.com/pa-grand-canyon-race-maps</strong> <strong>Photo Credit: Linda Starger and Andrew M.</strong></p>\r\n<p><strong><span style=\"text-decoration: underline;\">&nbsp;Bib Pick-up &amp; Registration:</span></strong> Will take place Friday July 26th 10:00 AM -7:00 PM &amp; Saturday July 27th 11:00AM-5:30PM @ Wild Asaph Outfitters located: 71 Main St, Wellsboro, PA&nbsp; (We will also have registration before the 5k starting at 7AM and on location for Sunday&nbsp; (if spots remain)</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Lodging:</span></strong>&nbsp; We recommend our friends at either the Sherwood Motel&nbsp; Located @ 2 Main St, Wellsboro, PA 16901 Website: <strong><a href=\"http://www.sherwoodmotel.org/\" target=\"_blank\" rel=\"noopener noreferrer\">http://www.sherwoodmotel.org/</a>&nbsp;</strong>or the historic Penn Wells Hotel &amp; Lodge Located @ 62 Mail St Wellsboro Pa Website: <a href=\"https://pennwells.com/\" target=\"_blank\" rel=\"noopener noreferrer\">https://pennwells.com/</a></p>\r\n<p><strong><span style=\"text-decoration: underline;\">Pasta Party + Expo:</span></strong>&nbsp; Benefits Second Chance Animal Sanctuaries of Wellsboro PA MORE INFO COMING</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Parking</span></strong>: Both days will be @Wellsboro High School.&nbsp; There will be NO onsite parking for the &frac12; &amp; Full.&nbsp; We have a local shuttle company that will be transporting people to &amp; from the race on the 28th</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Aid Stations:</span></strong> There will be aid stations w/first aid, Water and Gatorade Approx: every two miles!!&nbsp; (Some may even have a few treats!!) We will also have paramedics on course</p>\r\n<p><strong><span style=\"text-decoration: underline;\">FEES</span></strong>: Half marathon-&nbsp;$65 until&nbsp; 1/1/2019, $75 until 4/1/2019, $85 until Race Day (IF not sold out) &nbsp;Full Marathon- $80 until 1/1/2019, $90 until 4/1/2018 then $100 until Race Day (IF not sold out)&nbsp; 5k- $30 until 4/1/2019, $35 up to Race Day, 1 Mile is $10 Challenge: 5k &amp; Half- $85 Until 1/1/2019, $90 until 4/1/2019 $100 after 5k &amp; Full- $95 until 1/1/2019, $100 until 4/1/2019, $110 after</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Awards:</span></strong> &nbsp;Top 3 Male &amp; Female to go with top masters Male &amp; Female (40+.) There will also be age group awards for both male and female runners.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Age Groups</span></strong>: (Both &frac12;, Full &amp; 5K) 13-19, 20-24, 25-29, 30-34,35-39, 40-44, 45-49, 50-54, 55-59, 60-64, 65-69, 70+</p>\r\n<p><strong><span style=\"text-decoration: underline;\">T-Shirts:</span></strong> Amazing race themed Short sleeve tech shirt!!</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Finisher&rsquo;s Medals:</span></strong>&nbsp; Unique Medal Symbolic for the PA Grand Canyon will be awarded to all Participants in the 1/2 &amp; Full!!&nbsp; Also, we will have a special Additional (2nd) Medal for those that participant in the Conquer the Canyon Challenge!! Doing either the 5k &amp; Full or 5k &amp; Half!!</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Time Limit:</strong></span>&nbsp; 7 Hours for both the 1/2 &amp; 26.2</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Average Temperature:</span></strong>&nbsp; Low is 58/High is 78, Because of the unique location temperatures will be mild compared to most areas in the Summer</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Finish Line:</span></strong> There will be a live DJ/Entertainer at the start/finish area during the duration of the race</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Charities:</strong></span>&nbsp; We will be working with some local organizations including: Second Chance Animal Sanctuary and the high school</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Coaching:</span> </strong>&nbsp;Do you need a little extra help and motivation? We also offer a 14-week individual training plan with one on one coaching (if needed) upon registration! Please contact us @ schuylkillriverrunners@gmail.com for more information.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Wellsboro:</span></strong>&nbsp; The combination of beauty, forests, stores and rich history of this area make this a sure fire destination race for a summer weekend getaway!!&nbsp; We would be Honored to have you!!</p>\r\n<p>Check us out @ www.SchuylkillRiverRunners.com</p>\r\n<p>Email: &nbsp;<strong>schuylkillriverrunners@gmail.com</strong></p>",
