                "description": "<p>Come celebrate the USA on July 6th. &nbsp;</p>\r\n<p>&nbsp;The ACTS &amp; MTT Run/Walk 5K 10K is a beautiful course in Warsaw, IN. &nbsp;Both distances will give you a view of Pike Lake and include an amazing finish as you go through the Beyer Farm trail. &nbsp;Runners and walkers have said this is a wonderful course and can't wait to participate each year. &nbsp;Water will be available throughout the course. &nbsp;</p>\r\n<p>The 5K and 10K is a timed race and your race results will be availabe to you quickly and accurately. &nbsp;We are proud to have 5 year age groups in the 5k; Awesome medals for the top 3 in each age group. &nbsp;In the 10K it is a 9 year age group with top 3 in each age group receiving medals. &nbsp;We will have overall winner Awards for male and female for both the 5K and 10K distances. &nbsp;</p>\r\n<p>A Portion of the net proceeds will be donated to help veterans of our military. &nbsp;This is a celebration of our freedom and a thank you to those brave men and women that serve and sacrifice for our country.</p>\r\n<p>This event will also help MTT to enrich the health and well being of individuals with disabilities. &nbsp;</p>\r\n<p>Come run or walk in honor of the 4th of July and our freedom &nbsp;</p>\r\n<p>Register now to win a Garmin watch! If you register in July 2018 your name is put into a drawing 12 times to win the Garmin. &nbsp;If you wait and register until August your name is placed into drawing 11 times and so on. &nbsp;Register today!</p>\r\n<p><span style=\"color: #ff0000;\">5K age group: 11 &amp; under; 12-15; 16-19; 20-24; 25-29; 30-34; 35-39; 40-44; 45-49; 50-54; 55-59; 60-64; 65 &amp; over</span></p>\r\n<p><span style=\"color: #ff0000;\">10K age group: 16 &amp; under; 17-25; 26-34; 35-43; 44-52; 53 &amp; over</span>.</p>",
