                "description": "<p>Sponsored by Vietnam Veterans of America to honor our Vets. This race helps to raise money for veterans that are in need, whether it be for living, medical or helping to purchase trac chair to help disabled vets around. &nbsp;We also fund 3 scholarships for high school students coming out of high school &amp; also 3 college scholarships for students attending college. &nbsp;Many different special projects that our chapter thinks of. &nbsp;Show your support to our veterans. &nbsp;Freedom isn't free.</p>\r\n<p>Location: Dewey Short Visitors Center, 4500 State Hwy 165 Branson, MO</p>\r\n<p>Packet Pickup Friday 5-7pm. Race day registration from 6:00 to 6:30am.</p>\r\n<p>Half Marathon will begin at 6:45am &ndash; 5K will begin at 7:30am</p>\r\n<p>Race Course: Dewey Short Visitors Center to Lakeshore Trail to State Park Marina</p>\r\n<p>(Asphalt surfaced trail)</p>\r\n<p>Fast, out &amp; back course; with a scenic view of Table Rock Lake every step of the way!</p>\r\n<p>* 5K will be one loop of 3.1 miles &amp; Half Marathon is 3 loops of 4.36 miles each</p>\r\n<p>Information: Race Director - Denise Greeno, 417-263-0412</p>\r\n<p>&nbsp;</p>\r\n<p>Awards for each race: Trophies to Overall Male &amp; Female; Overall Masters Male &amp; Female</p>\r\n<p>Age group awards (Male &amp; Female) 14 &amp; under, 15-19, 20-29, 30-39, 40-49, 50-59, 60+</p>\r\n<p>Awards for 5K will be at 8:30am, Half Marathon awards will be after the last runner comes across the finish line.</p>\r\n<p>All race proceeds will go to the Local Branson VVA Chapter. (All payments are final)</p>\r\n<p>&nbsp;</p>",
