                "description": "<p><span style=\"color: #000000;\"><strong>Lets Have some Winter Fun (craziness?)&nbsp;</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong>WE ARE BACK FOR YEAR 3 with 2 course options!&nbsp;</strong></span></p>\r\n<p><strong><span style=\"color: #000000;\">WHERE?: &nbsp;</span></strong><span style=\"color: #000000;\">To encourage more participation and offer a warm dry place to check in and go post race we have partnered with Cool Springs Fitness to provide you with rest rooms, heat, and a dry place to relax!</span></p>\r\n<p><span style=\"color: #000000;\">OPTION 1: &nbsp;1 mile Fun Run / Walk - This option is for those people that want to be a part, but not run down a long hill, just to run back up. (40' of elevation drop, then 40' back up!)</span></p>\r\n<p><span style=\"color: #000000;\">OPTION 2: &nbsp;5K Run (Down the hill 150' of drop... and Up the Hill, You're welcome!).</span><span style=\"color: #000000;\">&nbsp;</span></p>\r\n<p><span style=\"color: #000000;\"><strong>WHY?: &nbsp;</strong>Proceeds will be used to Purchase and Donate Presents for Children's Aid Society. &nbsp; Unwrapped gifts and wrapping paper donations are also encouraged. &nbsp;</span></p>\r\n<p><strong><span style=\"color: #000000;\">Sponsors: &nbsp;</span></strong><span style=\"color: #000000;\">We know christmas can be a tough time financially, so small amounts and big results. &nbsp;If your employer is looking for a worthy cause, please let them know about this race!</span></p>\r\n<p><span style=\"color: #000000;\"><strong>WHEN:</strong> &nbsp;Sunday, December 9th, &nbsp;2:00PM (because it's winter and it's the warmest part of the day!)</span></p>\r\n<p><span style=\"color: #000000;\">&nbsp; &nbsp;<strong>Race Day Registration and Bib Pick Up starting at 12:30PM</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong>WHERE:</strong> &nbsp;Start and Finish at the Cool Springs Fitness.</span></p>\r\n<p><span style=\"color: #000000;\"><strong>COURSE:&nbsp;</strong> Starting just outside CSF parking lot. &nbsp;Runners will go past the soccer fields and take a left bend in the road... then it's STRAIGHT DOWN THE HILL! &nbsp;1 Mile participants will turn around at Airport Rd. &nbsp;5K participants will head down the hill before making a u-turn and coming back the hill they just ran down!</span></p>\r\n<p><span style=\"color: #000000;\"><strong>WHAT DO YOU GET?</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong>Awards:</strong>&nbsp; Awards in the 5K only. &nbsp;TOP 3 Men &amp; Women. &nbsp;Top Male/Female in each Age Group: &nbsp;15 and Under, 16-19, 20-29, 30-39, 40-49, 50-59, 60-69, 70+.</span></p>\r\n<p><strong>Finish Medal and Shirt: &nbsp;</strong>New in 2018! &nbsp;All Awesome Event races will have a finish award and an event shirt, but we know you like stuff! &nbsp;There is an option for no shirt, the money that saves us will be added to the proceeds and donated accordingly!</p>\r\n<p><strong>Post Run:</strong><span style=\"color: #000000;\">&nbsp; Coffee, Water, Bananas, and Celebratory Cookies for all finishers.&nbsp;</span></p>\r\n<p><span><span style=\"color: #000000;\"><strong>Inclement</strong></span><strong>&nbsp;Weather: </strong><span style=\"color: #000000;\">&nbsp;It is winter, it could be super terrible or surprisingly awesome out. &nbsp;Add a long hill, potential ice/snow... and we all have no fun. &nbsp;We will make the decision Saturday by 5pm if we choose to cancel the run. &nbsp;All Proceeds still go to helping our local children in need. &nbsp;I will make thank you medals and send them out in the event we have to cancel the race. They will say: Two for Tots - Santa's Helper. &nbsp;That's fun!!</span></span></p>\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>",
