                "created": "1/31/2016 12:08",
                "last_modified": "11/24/2018 19:44",
                "description": "<h3 style=\"text-align: center;\"><strong>Black Friday Special!</strong></h3>\r\n<h4 style=\"text-align: center;\"><strong>Use coupon code&nbsp;<span style=\"color: #ff0000;\">GRTCBFSales&nbsp;</span>and get $5 off of registration fees when you register on November 23, 2018. </strong></h4>\r\n<h4 style=\"text-align: center;\"><strong>Offer expires on November 30, 2018</strong></h4>\r\n<p><strong>Where:</strong> <a href=\"http://www.flcc.edu/\" target=\"_blank\" rel=\"noopener noreferrer\">Finger Lakes Community College</a> <a href=\"https://www.google.com/maps/place/3325+Marvin+Sands+Dr,+Canandaigua,+NY+14424/@42.868169,-77.2442292,17z/data=!3m1!4b1!4m5!3m4!1s0x89d126e1b81f9351:0x31c77f2fe0cc49de!8m2!3d42.868169!4d-77.2420405\" target=\"_blank\" rel=\"noopener noreferrer\">3325 Marvin Sands Dr, Canandaigua, NY US 1442</a></p>\r\n<p><strong>When</strong>: Saturday, October 12, 2019</p>\r\n<p><strong>Start Times</strong></p>\r\n<ul>\r\n<li>50 Mile starts at 7:30AM</li>\r\n<li>50 Mile early starts at 6:30AM</li>\r\n<li>50 Km starts at 10:00AM</li>\r\n<li>25 Km starts at 1PM</li>\r\n</ul>\r\n<p><strong><span>Finish closes at 7:30PM for all courses</span></strong></p>\r\n<p>Looking for a well-supported run in a spectacular setting with attractions for the whole family?&nbsp; Whether your goal is to run a first ultra, conquer a challenging 50-miler, or set a personal record, the <strong>Can Lake 50</strong> is the race for you.</p>\r\n<h5>50 Mile</h5>\r\n<p>Run one big road loop around the most beautiful Finger Lake in Western New York.&nbsp; The course is mostly flat to rolling roads with several major climbs, including locally-famous Bopple Hill.</p>\r\n<p><span style=\"text-decoration: underline;\"><a href=\"http://www.mapmyrun.com/routes/view/529095328\" target=\"_blank\" rel=\"noopener noreferrer\">MapMyRun 50M CanLake50 Race Course</a></span></p>\r\n<h5>50 Km</h5>\r\n<p>Run point-to-point over the final 31 miles of the 50 Mile route.&nbsp; With significantly less climbing and descending than the first 19 miles of the 50 Mile route, the 50K is more friendly for first-time ultra runners and a logical step up from the marathon.</p>\r\n<p><span style=\"text-decoration: underline;\"><a href=\"http://www.mapmyrun.com/routes/view/451172690\" target=\"_blank\" rel=\"noopener noreferrer\">MapMyRun 50Km CanLake50 Race Course</a></span></p>\r\n<h5>25 Km</h5>\r\n<p><br/>Run point-to-point over the final 14.5 miles of the 50 Mile/50 Km route after running short out-and-back starting on and using South Lake road. Time limit is 6 1/2 hours. Minimum average speed to complete 25Km race is 2.07 miles per hour or 25 minutes per mile. Please note that 25Km race won't allow pacers.</p>\r\n<p><a href=\"http://www.mapmyrun.com/routes/view/1995373568\" target=\"_blank\" rel=\"noopener noreferrer\">MapMyRun CanLake 25Km Race Course</a></p>\r\n<h5>Personal Handler</h5>\r\n<p>Having a personal handler at CanLake50 is privilege and perk that we are happy to provide. However, with this privilege comes the&nbsp;responsibility of learning and following the&nbsp;safety rules of the race. Make sure that your&nbsp;personal handlers follow the safety rules or your result will be disqualified. The waiver you will electronically sign includes the following text.</p>\r\n<p>PERSONAL HANDLER WAIVER. (For runners that plan to use personal handler at the CanLake50) I accept full responsibility for the actions of the personal handler(s), that personal handler(s) will familiarize themselves with&nbsp;and follow all safety rules outlined in the Race Handbook. Failure to follow safety rules by personal handler(s) -intentional or unintentional - will result in&nbsp;<strong>DISQUALIFICATION&nbsp;</strong>of the runner</p>\r\n<h5>Refunds</h5>\r\n<ul>\r\n<li>$60 until 08/12/2019</li>\r\n<li>$40 until 09/12/2019</li>\r\n<li><strong><em>No refunds after 09/12/2019</em></strong></li>\r\n</ul>\r\n<p><em><strong>No Deferrals and No Transfers&nbsp;</strong></em></p>\r\n<p>&nbsp;</p>\r\n<p>Join the CanLake50 Facebook group at <a href=\"https://www.facebook.com/groups/CanLake50/\" target=\"_blank\" rel=\"noopener noreferrer\">https://www.facebook.com/groups/CanLake50/</a> where you can pose questions to other race participants.</p>\r\n<p>Race Presented by <strong><a href=\"http://grtconline.org/\" target=\"_blank\" rel=\"noopener noreferrer\">The Greater Rochester Track Club</a></strong>&nbsp;(GRTC). Become a GRTC member and receive <strong>$5,- discount</strong> when signing up for the race.</p>",
