                "last_modified": "11/28/2018 16:50",
                "description": "<p>The Union County Health Department is celebrating a healthy Union County by encouraging individuals to Stay Active Year Round!</p>\r\n<p>Unfortunately, just like everyone else in the US, Union County's obesity rates are high, in our case higher than state and national averages. Unlike other areas, Union County has a nice network of trails and plans to expand them, so we would like to encourage people to get out and move no matter the weather or time of year!</p>\r\n<p><br/>Your call to action for the Stay Active Year Round campaign for the spring is to participate in the #StayActive 5k. The race starts at Mill Creek Park (by the soccer fields) and runs up the Jim Simmons Trail into Mill Valley North and then back over the pedestrian bridge. All proceeds benefit the Union County Health Department and allow us to provide mini-grants to local schools to encourage youth to learn life long health habits like running and walking!</p>\r\n<p>&nbsp;</p>\r\n<h4><span style=\"text-decoration: underline;\"><strong>Packet Pickup:<br/></strong></span>March 15, 2019<br/>10:00 a.m. - 6:00 p.m.<br/>Union County Health Department <br/>940 London Ave #1100, Marysville, OH 43040</h4>",
