                "created": "11/22/2012 23:37",
                "last_modified": "11/15/2018 10:34",
                "description": "<p><strong><span style=\"color: #993300;\">SIGN UP NOW ... America's Most Exciting Family Friendly Adventure Race! ~ Donate Sneakers for Cancer!</span></strong><br/>Supporting Pediatric Cancer and 30 Minutes-a-Day Academic Initiative</p>\r\n<p>Official website:&nbsp;www.GreatAmazingRace.com</p>\r\n<p>&nbsp; Get ready to enjoy America's most exciting family-friendly adventure race. Modeled after the popular TV show &quot;The Amazing Race&quot;, two person teams race in competition with other similar age teams. Teams complete a variety of fun physical challenges at multiple stops along the course. &quot;Teamwork&quot; is the key skill as each challenge requires the involvement of both racers in order to complete before advancing.</p>\r\n<p>&nbsp; &nbsp;Walk, jog or run - and be prepared to get a little dirty &amp; wet.&nbsp; It's a great bonding experience and way more fun than a 5K race!</p>\r\n<p>&nbsp;Waves begin every 10 minutes - kids teams, then adult teams.</p>\r\n<p>1. Open for ages 4 to 84.<br/>2. 2 person teams ... adult/adult, adult/kid or kid/kid.<br/>3. 2 course levels ... Recreation (for leisure pace teams) &amp; Competitive (for physically active teams). &nbsp;<br/>4. 4 race divisions ... Grades K-2 / 3-5 / 6-8 / 9-Adult.&nbsp;<br/>5. 1st place medals are awarded to each division winner. &nbsp;<br/>6. Plan on 60 minutes to complete course ... race happens rain or shine.</p>\r\n<p>CHARITY PARTNER: Help us fight pediatric cancer by donating 2 pairs of used sneakers or running shoes at the race ... and receive a 2 minute time eraser token.&nbsp;</p>",
