                "last_modified": "11/14/2018 09:52",
                "description": "<p>The&nbsp;Healthy Kids Running Series (HKRS)&nbsp;is a national, community-based non-profit that provides a fun, inclusive, five-week running series for ages 2-14 designed to get kids active, experience accomplishment and lay the foundation for a healthy lifestyle.&nbsp;HKRS&nbsp;encourages kids to adopt a &ldquo;Get Up and Go!&rdquo; attitude.</p>\r\n<p>To celebrate the 10-year anniversary of Healthy Kids Running Series and our mission to get kids active and lay the foundation for a healthy lifestyle we are hosting 10 Fest events in (3) regions across the country! Join us from 1pm to 4pm for ongoing activities and our running events!&nbsp;These events are&nbsp;<span style=\"color: #00ff00;\"><strong>one day only&nbsp;</strong></span>and will include a commemorative anniversary t-shirt, games, entertainment, special guests, lots of interactive activities for the kids and fun for the whole family!</p>\r\n<p>Chicago, IL &ndash; Sunday, October 13th @ Kane County Cougars Stadium (Geneva, IL)</p>\r\n<p><a href=\"/Race/FL/Orlando/HealthyKidsRunningSeries10FestOrlandoFL\" target=\"_blank\" rel=\"noopener noreferrer\">Orlando, FL &ndash; Sunday, March 10 @ Blue Jacket Park</a></p>\r\n<p><a href=\"/Race/PA/Media/10FestPhilly\" target=\"_blank\" rel=\"noopener noreferrer\">Philadelphia, PA &ndash; Sunday, May 19 @ Rose Tree Park (Media, PA)</a></p>\r\n<p>Healthy Kids Running Series&nbsp;offers age appropriate running events including the 50 &amp; 75 yard dashes, the 1/4 mile, the 1/2 mile and the one-mile run. Kids compete for a chance receive a trophy in their respective age division at the end of the event.</p>\r\n<p><em><strong>Our event is Rain or Shine. The non-refundable registration fee covers the race and all kid activities.</strong></em></p>",
