                "created": "1/22/2016 11:56",
                "last_modified": "11/21/2018 21:06",
                "description": "<p>Ten years and over 2,000 athletes!&nbsp; The Shyann Kindness Project's Annual &quot;Tri&quot; for Acts of Kindness SPRINT Tri/Du/5K Run/Walk has grown and blossomed to be one of Tucson's premier athletic events. This year we are incorporating a Toy Drive as part of the registration process to help us provide Kindness Gift packages for the 24 events we host annually for underprivileged and medically fragile children.</p>\r\n<p>If this is your first Triathlon, Duathlon or 5K, or if you are you getting ready for a full Triathlon, Duathlon or a Marathon, our 10th Annual SPRINT Triathlon/Duathlon and 5K Run/Walk just might be the perfect event to get you warmed up and tuned up!</p>\r\n<p>Perfect distances for First Timers and Beginners and fun and relaxed for more experienced triathletes, duathletes and runners!</p>\r\n<p>What Our Event Supports: The Shyann Kindness Project (TSKP) is a 100% volunteer organization that has served more than 23,000 underprivileged, at-risk, and/or medically fragile children since 2006. Our Kindness Gift-Giving Events are both a teaching and gifting program that takes place throughout the year at venues including low-income schools, shelters, group homes, Head Start programs, homeless meal programs, and TMC's Pediatric Emergency Center.</p>\r\n<p>Annual events include &quot;Backpack Night&quot; for children in the Sunnyside Neighborhood and a Christmas party for 200 children plus their parents or caregivers that takes place at a different school each year.</p>",
