                "created": "10/14/2015 10:47",
                "last_modified": "11/15/2018 10:35",
                "description": "<p>Stanley Edwards had a dream: his dream was to attend college. Unlike many 12-year olds, achieving his dream was complicated by the battle he was fighting against brain cancer.<br/>A gifted student and promising athlete, Stanley was diagnosed with a brain tumor at age 12. Due to the location of the tumor, surgery to remove it resulted in the onset of learning disabilities as well as paralysis of his right arm and leg, making school more difficult and forever preventing him from participating in the many sports he loved.</p>\r\n<p>Despite these unthinkable obstacles, Stanley persevered toward his dream. Unexpectedly, in 2001 the Edwards family learned that Stanley's tumor had returned. Stanley passed away in January of 2002 at the age of 14. In a tribute to this courageous young man, his family created Stanley's DREAM to continue his legacy.</p>\r\n<p>Stanley's DREAM provides college scholarships to graduating seniors and supports childhood brain cancer research by awarding research grants to hospitals.</p>",
