                "description": "<p>Please join us 11/28/2019 8:30:00 AM for the 11th annual COC Turkey Trot.</p>\r\n<p>Medals given to all competitors!</p>\r\n<p>Be sure to bring a check or cash to the race to pay your race fee, you won't be charged to sign up using this link. Registration is free, but when you pick up your bib, you will need to pay at that time.</p>\r\n<p>The College of the Canyons Athletics Department invites community members of all ages to run, walk, or jog in the tenth annual Thanksgiving Day &lsquo;Turkey Trot&rsquo; event benefiting the college&rsquo;s cross country and track &amp; field programs.</p>\r\n<p>At the event, participants will run a three-mile cross country course through the COC Valencia campus, beginning at the college&rsquo;s baseball field and continuing through the campus, winding through the hills overlooking the Santa Clarita Valley, and finally finishing inside Cougar Stadium.</p>\r\n<p>The event begins at 8:30 a.m. on Thanksgiving Day, Thursday, Nov. 28, 2019.</p>\r\n<p><span style=\"text-decoration: line-through;\">Registration takes place at the race start, so no pre-registration is necessary. Participants can sign-in at the track finish line on the day of the event.</span></p>\r\n<p>You may also sign up via this website</p>\r\n<p>An entry fee of $20.00 per runner includes a race T-shirt. Checks can be made payable to &ldquo;COC ASG.</p>\r\n<p>Finishing times for each participant will be announced at the end of the race. Awards will also be given to the top three men and women in each age division.</p>\r\n<p>For more information about the tenth annual Thanksgiving Day &lsquo;Turkey Trot&rsquo; event please contact COC cross country/track &amp; field head coach Lindie Kane at (661) 755-8162.</p>",
